import './App.css';
import { GlobalState } from './context/globalState';
import LoginPage from './pages/loginPage/loginPage';
import RouterPage from './routes/routerPage';

function App() {
  return (
    <RouterPage>
      <GlobalState>
        <LoginPage/>
      </GlobalState>
    </RouterPage>
  );
}

export default App;
